('044e0e9e-daf1-4a31-9b5b-6aeb5fd55322', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-07-28 14:56:07', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-07-28 15:03:57', NULL, b'0', 'insertBusinessObjectMessage', 'Insert Business Object Message', 'INSERT INTO data_catalog_business_object_message (created_by, data_catalog_business_object_id, message) VALUES ( \'##userid##\', \'##boid##\', \'##message##\');', NULL),
('04ebd7de-1814-4f71-ba89-b5eac484a431', '54', '2022-06-17 09:46:40', '54', '2022-06-17 09:46:40', NULL, b'0', 'aa', 'aa', 'SELECT COUNT(*) FROM asset\nWHERE code = \'##code##\'\nAND id = \'##id##\'\nAND created_by = \'##userid##\';', NULL),
('1f25b190-2161-4e69-94c0-6623f08983c2', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-07-17 22:31:26', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-07-19 08:51:26', NULL, b'0', 'AddDataView', 'Add Data View', 'INSERT INTO data_views (id, user_id, data_id) VALUES (\'##row_id##\', \'##userid##\', \'##data_id##\');\n ', NULL),
('4e768dc2-cde3-46fe-bf29-e7fc82564de3', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2024-05-01 08:27:16', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2024-05-01 08:29:09', NULL, b'0', 'my-offered-service-enable', 'my-offered-service-enable', 'UPDATE data_catalog_data_offerings\nSET status = \'active\'\nWHERE id = :offered_service_id\nAND created_by = :userid', 'my-offered-service-enable'),
('65d27a30-e2e3-4372-b142-8ae82f0ba2f9', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-10-11 09:00:33', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-11-17 13:02:27', NULL, b'0', 'getOnenetAddresses', 'Get Consumer - Provider Addresses By data_send Id', 'SELECT doffer_u.ecc_url, doffer_u.broker_url, req_u.data_app_url\nFROM data_send ds\nINNER JOIN data_catalog_data_offerings doffer ON doffer.id = ds.data_catalog_data_offerings_id\nINNER JOIN user doffer_u ON doffer_u.id = doffer.created_by\nINNER JOIN data_catalog_data_requests req ON req.data_catalog_data_offering_id = doffer.id\nINNER JOIN user req_u ON req_u.id = req.owner_id\nWHERE ds.id = :data_send_id\nAND req.owner_id = :userid', NULL),
('74c9e3bc-4e26-4d74-aefb-a5ab4b364c1e', '84dc0ae1-a1bb-4cb3-9d9c-a2eea33eb736', '2022-07-25 09:50:29', '84dc0ae1-a1bb-4cb3-9d9c-a2eea33eb736', '2022-07-25 10:31:14', NULL, b'0', 'updateOnenetUser', 'updateOnenetUser', 'UPDATE user\nSET ed_api_url = \'##ed_api_url##\', \ndata_app_url = \'##data_app_url##\', \necc_url = \'##ecc_url##\', \nbroker_url = \'##broker_url##\'\nWHERE id = \'##userid##\';', NULL),
('94f1846c-0e0b-42fa-9686-3b5cfa06def1', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-11-21 16:04:57', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-11-21 16:04:57', NULL, b'0', 'getMyDataOfferingById', 'getMyDataOfferingById', 'SELECT id,status FROM data_catalog_data_offerings WHERE created_by = :userid AND status = \'active\' AND id = :data_offering_id', NULL),
('a4ca8cb3-a1a8-4177-a261-301080705f01', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2023-09-18 08:06:14', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2023-09-18 08:08:50', NULL, b'0', 'addUserRole', 'Add Role to User', 'INSERT INTO `user_role`(`user_id`, `role_id`) VALUES (:new_user_id,\'b07c1c46-d065-4bca-9981-d0b7d981e045\');', NULL),
('a716cb83-dc93-4d49-b4ac-92e3185eb715', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-10-13 08:35:23', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-10-13 08:35:23', NULL, b'0', 'providerfiwareurl', 'GET provider_fiware_url', 'SELECT `data_app_url` AS provider_fiware_url FROM `user` WHERE id = :userid', NULL),
('b3336c63-b949-4c8e-a3f6-ab42e37c08f5', 'da7a00e9-3b19-454d-b72b-8646d6eae678', '2022-10-31 14:51:49', 'da7a00e9-3b19-454d-b72b-8646d6eae678', '2022-11-01 15:53:19', NULL, b'0', 'datasendActive', 'Update data_send set active (Post)', 'UPDATE data_send\nSET status = \'active\'\nWHERE id = :data_send_id\nAND created_by = :userid', NULL),
('ba4a18ed-1b60-4627-9757-d0619da32f49', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-07-17 22:24:01', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-07-17 22:24:01', NULL, b'0', 'CountDataViews', 'Count Data Views', 'SELECT COUNT(id) AS total FROM data_views WHERE user_id = \'##userid##\' AND data_id = \'##data_id##\'', NULL),
('d1994190-3b88-49eb-8bd7-52260222d57a', 'da7a00e9-3b19-454d-b72b-8646d6eae678', '2022-09-30 10:10:55', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-11-17 13:03:48', NULL, b'0', 'myConsumersList', 'My Consumers List', 'SELECT DISTINCT u.username, u.data_app_url, u.ecc_url, c.name\nFROM data_catalog_data_requests dr \nINNER JOIN user u ON u.id = dr.owner_id\nINNER JOIN company c ON c.id = u.company_id\nINNER JOIN data_catalog_data_offerings dofr ON dr.data_catalog_data_offering_id = dofr.id\nWHERE dofr.created_by = \'##userid##\'\nAND dr.status = \'accept\'', NULL),
('dbeed0cd-905c-4ac6-ab01-e064a9d637ed', '54', '2022-06-13 10:19:25', 'da7a00e9-3b19-454d-b72b-8646d6eae678', '2022-09-30 08:47:49', NULL, b'0', 'businessobject', 'Business Object', 'SELECT  bo.id AS a, bo.code AS b, bo.name AS c, \ns.code AS d, s.name AS e, c.code AS f, c.name AS g,\nbo.file_schema,\nbo.file_schema_filename,\nbo.file_schema_sample,\nbo.file_schema_sample_filename,\nbo.profile_selector,\nbo.profile_description\nFROM data_catalog_business_object bo\nINNER JOIN data_catalog_service s ON bo.data_catalog_service_id = s.id\nINNER JOIN data_catalog_category c ON s.data_catalog_category_id = c.id\nWHERE  bo.id = \'##bo_id##\'', NULL),
('e48046c9-0b94-41d2-9ad4-206f1604b821', '84dc0ae1-a1bb-4cb3-9d9c-a2eea33eb736', '2022-07-22 08:33:30', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2023-09-25 15:06:36', NULL, b'0', 'getUser', 'Get User', 'SELECT \nu.id, \nu.username, \nu.email,\nu.ed_api_url,\nu.data_app_url,\nu.ecc_url, \nu.broker_url,\nc.name\nFROM user u \nLEFT OUTER JOIN company c on u.company_id = c.id\nWHERE u.id = :userid', NULL),
('fad47a24-fcf0-4864-b9f2-86d8f442ddf7', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2024-05-01 08:28:58', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2024-05-01 08:28:58', NULL, b'0', 'my-offered-service-disable', 'my-offered-service-disable', 'UPDATE data_catalog_data_offerings\nSET status = \'disabled\'\nWHERE id = :offered_service_id\nAND created_by = :userid ', 'my-offered-service-disable');
