('07bf99ed-80ea-427d-9cd5-5e187761425e', NULL, '2022-05-26 09:12:57', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-11-17 13:06:02', NULL, NULL, 'LIST[LOCATE:(ID=f2c905fe-6597-4dd5-b648-7d76d07c787f)]', 'fa-search', 'Go to Data Consumed List', b'0', NULL, NULL, 'SELECT  \nCONCAT(\'<div style=\"padding-bottom: 14px;\">\', IFNULL(a.totalres,0),\' Total</div>\') as data,\n\'<div style=\"padding-bottom: 15px;\">Your Data Entities Consumed</div>\' AS title,\n\'fa-file-medical\' AS icon,\n\'#004577\' AS icon_color\nFROM\n(SELECT  count(ds.id) AS totalres\nFROM data_send ds\nINNER JOIN data_catalog_data_offerings do on do.id = ds.data_catalog_data_offerings_id\nINNER JOIN data_catalog_data_requests dr on dr.data_catalog_data_offering_id = do.id\nWHERE dr.status = \'accept\' AND dr.owner_id = ##user_id##) a', 'Your Data Entities Consumed', 'class InfoCardDynamicScript07bf99ed_80ea_427d_9cd5_5e187761425e {\nconstructor() {}\n\ninfoCardRef = null;\n\nnavigateRef = null;\ngetFromBackendRef = null;\n\ndefineInfoCardNavigator(myCallback){this.navigateRef = myCallback;}\nnavigate(command){return this.navigateRef(command);}\ndefineGetFromBackend(myCallback){this.getFromBackendRef = myCallback;}\ngetFromBackend(url, callback){return this.getFromBackendRef(url, callback);}\ndefineGetFromUrl(myCallback){this.getFromUrlRef = myCallback;}\ngetFromUrl(url, callback){return this.getFromUrlRef(url, callback);}\n\n\n\nnativeListEventsHandler(type, metadata) {\nif((type == \'onInfoCardOpen\') && (typeof this.onInfoCardOpen == \"function\")) this.onInfoCardOpen(metadata);\nif((type == \'onInfoCardDataLoaded\') && (typeof this.onInfoCardDataLoaded == \"function\")) this.onInfoCardDataLoaded(metadata);\n}\n}', '\nclass InfoCardDynamicScript07bf99ed_80ea_427d_9cd5_5e187761425e{constructor(){}\ninfoCardRef=null;navigateRef=null;getFromBackendRef=null;defineInfoCardNavigator(myCallback){this.navigateRef=myCallback;}\nnavigate(command){return this.navigateRef(command);}\ndefineGetFromBackend(myCal