('50c25b58-1d4b-4036-80e6-f68e1988b8c8', NULL, '2022-07-28 09:28:26', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-09-06 13:18:18', NULL, NULL, 'LIST[LOCATE:(ID=607fe472-e51d-44c5-a9c3-ba8ec09208d0)]', 'fa-search', 'Pending Subscription Requests to Your Offers', b'0', NULL, NULL, 'SELECT  \nCONCAT(\'<div style=\"padding-bottom: 14px;\">\', IFNULL(a.totalPending,0),\' Pending</div>\') as data,\n\'<div style=\"padding-bottom: 15px;\">Pending Subscription Requests to Your Offers</div>\' AS title,\n\'fa-handshake\' AS icon,\n\'rgb(155 116 148)\' AS icon_color\nFROM\n(SELECT (SELECT count(dr.id) AS totalAccepted\nFROM data_catalog_data_requests dr\nINNER JOIN data_catalog_data_offerings do on do.id = dr.data_catalog_data_offering_id\nWHERE do.created_by = ##user_id## AND dr.status = \'pending\') AS totalPending ) a', 'Pending Subscription Requests to Your Offers', 'class InfoCardDynamicScript50c25b58_1d4b_4036_80e6_f68e1988b8c8 {\nconstructor() {}\n\ninfoCardRef = null;\n\nnavigateRef = null;\ngetFromBackendRef = null;\n\ndefineInfoCardNavigator(myCallback){this.navigateRef = myCallback;}\nnavigate(command){return this.navigateRef(command);}\ndefineGetFromBackend(myCallback){this.getFromBackendRef = myCallback;}\ngetFromBackend(url, callback){return this.getFromBackendRef(url, callback);}\ndefineGetFromUrl(myCallback){this.getFromUrlRef = myCallback;}\ngetFromUrl(url, callback){return this.getFromUrlRef(url, callback);}\n\n\n\nnativeListEventsHandler(type, metadata) {\nif((type == \'onInfoCardOpen\') && (typeof this.onInfoCardOpen == \"function\")) this.onInfoCardOpen(metadata);\nif((type == \'onInfoCardDataLoaded\') && (typeof this.onInfoCardDataLoaded == \"function\")) this.onInfoCardDataLoaded(metadata);\n}\n}', '\nclass InfoCardDynamicScript50c25b58_1d4b_4036_80e6_f68e1988b8c8{constructor(){}\ninfoCardRef=null;navigateRef=null;getFromBackendRef=null;defineInfoCardNavigator(myCallback){this.navigateRef=myCallback;}\nnavigate(command){return this.navigateRef(command);}\ndefineGetFromBackend(myCallback){this.getFromBackendRef=myCallback;}\ngetFromBackend(url,callback){return this.getFromBackendRef(url,callback);}\ndefineGetFromUrl(myCallback){this.getFromUrlRef=myCallback;}\ngetFromUrl(url,callback){return this.getFromUrlRef(url,callback);}\nnativeListEventsHandler(type,metadata){if((type==\'onInfoCardOpen\')&&(typeof this.onInfoCardOpen==\"function\"))this.onInfoCardOpen(metadata);if((type==\'onInfoCardDataLoaded\')&&(typeof this.onInfoCardDataLoaded==\"function\"))this.onInfoCardDataLoaded(metadata);}}'),
('62e528c2-971b-4c44-a811-ea8fe596f02a', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-09-06 13:58:23', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2023-05-17 08:15:30', NULL, NULL, 'FORM[LOCATE:(ID=aca2bb64-9cf0-4454-8386-ac466768d52b)]', 'fa-search', 'Go To Your Connector Settings', b'0', NULL, NULL, 'SELECT  \n\'<div style=\"padding-bottom: 14px;font-size: 12px;\"> Checking connections <br>please wait ... </div>\' as data,\n\'<div style=\"padding-bottom: 15px;\">Connector Check</div>\' AS title,\n\'fa-wifi\' AS icon,\n\'#aeaeae\' AS icon_color', 'Connection Settings', 'class InfoCardDynamicScript62e528c2_971b_4c44_a811_ea8fe596f02a {\nconstructor() {}\n\ninfoCardRef = null;\n\nnavigateRef = null;\ngetFromBackendRef = null;\n\ndefineInfoCardNavigator(myCallback){this.navigateRef = myCallback;}\nnavigate(command){return this.navigateRef(command);}\ndefineGetFromBackend(myCallback){this.getFromBackendRef = myCallback;}\ngetFromBackend(url, callback){return this.getFromBackendRef(url, callback);}\ndefineGetFromUrl(myCallback){this.getFromUrlRef = myCallback;}\ngetFromUrl(url, callback){return this.getFromUrlRef(url, callback);}\n\nonInfoCardOpen(type) {\r\n     this.getUserData();\r\n}\r\n\r\ngetUserData(){\r\n    this.getFromBackend(\r\n        \'/custom-query/data-objects/?id=e48046c9-0b94-41d2-9ad4-206f1604b821\',\r\n        (response) => {\r\n           console.log(response[0][\'ed_api_url\']);\r\n           this.checkLocalApiExistance(response[0][\'ed_api_url\']);\r\n        }\r\n    );\r\n}\r\n\r\ncheckLocalApiExistance(localApi) {\r\n    \r\n    var headers = [];\r\n    headers[\'no-global-error\'] = \'yes\';\r\n    headers[\'no-global-loader\'] = \'yes\';\r\n    this.infoCardRef.getFromUrlWithCustomHeaders(\r\n        localApi + \'/health\',\r\n        headers,\r\n        (response,result) => {\r\n            if(result == false){\r\n                this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local Application Not Found.</b> Install or configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings.</div>\';\r\n                this.checkVersionCombatibility();\r\n            } else {\r\n                this.requestLocalApiToCheckOnenetInfustructure(localApi);\r\n            }\r\n        }\r\n    );\r\n    \r\n}\r\n\r\nrequestLocalApiToCheckOnenetInfustructure(localApi){\r\n    var headers = [];\r\n    headers[\'no-global-error\'] = \'yes\';\r\n    headers[\'no-global-loader\'] = \'yes\';\r\n    this.infoCardRef.getFromUrlWithCustomHeaders(\r\n        localApi + \'/check-connectivity\',\r\n        headers,\r\n        (response,result) => {\r\n            if(result == false){\r\n                this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local API Application Version is Old.</b> Please upgrade to the latest Version.</div>\';\r\n            } else {\r\n                if(response.code == \'0\'){\r\n                      this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> You are ready to Provide & Consume Data.\';\r\n                      this.infoCardRef.dto.iconColor = \'#4cb96e\';\r\n                } else if(response.code == \'1\' || response.code == \'2\' || response.code == \'3\'){\r\n                      this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> Install or configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings.</div>\';\r\n                      this.infoCardRef.dto.iconColor = \'#aeaeae\';\r\n                } else {\r\n                      this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> Configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings or talk to your network Administrator.</div>\';\r\n                      this.infoCardRef.dto.iconColor = \'#c1c100\';\r\n                }\r\n            }\r\n            this.checkVersionCombatibility(); \r\n        }\r\n    );\r\n}\r\n\r\ncheckVersionCombatibility() {\r\n let uiVersion = this.getUiVersion();\r\n this.getBackendVersionAndCompare(uiVersion);\r\n}\r\n\r\ngetBackendVersionAndCompare(uiVersion) {\r\n    var headers = [];\r\n    headers[\'no-global-error\'] = \'yes\';\r\n    headers[\'no-global-loader\'] = \'yes\';\r\n    this.infoCardRef.getFromBackendWithCustomHeaders(\r\n        \'/info/version\',\r\n        headers,\r\n        (response,result) => {\r\n            let backendVersion = \"\";\r\n            if(result == false){\r\n               backendVersion = \"1.0\";\r\n            } else {\r\n               backendVersion = response[\'version\'];\r\n            }\r\n            \r\n            if(uiVersion != backendVersion){\r\n                   this.infoCardRef.dto.cardText =\r\n                   this.infoCardRef.dto.cardText +\r\n                   \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local Ui Version</b> is <b>\' + uiVersion + \'</b> while <b>Central Registry Version</b> is <b>\' + backendVersion + \'</b>. \'+\r\n                   \'Upgrade Local Ui to Latest Version following the instructions on this <b><a style=\"color: #D57676;text-decoration: none;\" target=\"_blank\" href=\"https://github.com/european-dynamics-rnd/OneNet/wiki/Upgrade-Local-Api-to-the-latest-Version\">link</a></b>.\';\r\n                   this.infoCardRef.dto.iconColor = \'#D57676\';\r\n            }\r\n   \r\n        }\r\n    );\r\n}\r\n\r\ngetUiVersion() {\r\n    let uiVersion = \'\';\r\n    if (localStorage.getItem(\'uiVersion\')) {\r\n        uiVersion = localStorage.getItem(\'uiVersion\');\r\n    } else {\r\n        uiVersion = \'1.0\';\r\n    }\r\n    \r\n    return uiVersion;\r\n}\n\nnativeListEventsHandler(type, metadata) {\nif((type == \'onInfoCardOpen\') && (typeof this.onInfoCardOpen == \"function\")) this.onInfoCardOpen(metadata);\nif((type == \'onInfoCardDataLoaded\') && (typeof this.onInfoCardDataLoaded == \"function\")) this.onInfoCardDataLoaded(metadata);\n}\n}', '\nclass InfoCardDynamicScript62e528c2_971b_4c44_a811_ea8fe596f02a{constructor(){}\ninfoCardRef=null;navigateRef=null;getFromBackendRef=null;defineInfoCardNavigator(myCallback){this.navigateRef=myCallback;}\nnavigate(command){return this.navigateRef(command);}\ndefineGetFromBackend(myCallback){this.getFromBackendRef=myCallback;}\ngetFromBackend(url,callback){return this.getFromBackendRef(url,callback);}\ndefineGetFromUrl(myCallback){this.getFromUrlRef=myCallback;}\ngetFromUrl(url,callback){return this.getFromUrlRef(url,callback);}\nonInfoCardOpen(type){this.getUserData();}\ngetUserData(){this.getFromBackend(\'/custom-query/data-objects/?id=e48046c9-0b94-41d2-9ad4-206f1604b821\',(response)=>{console.log(response[0][\'ed_api_url\']);this.checkLocalApiExistance(response[0][\'ed_api_url\']);});}\ncheckLocalApiExistance(localApi){var headers=[];headers[\'no-global-error\']=\'yes\';headers[\'no-global-loader\']=\'yes\';this.infoCardRef.getFromUrlWithCustomHeaders(localApi+\'/health\',headers,(response,result)=>{if(result==false){this.infoCardRef.dto.cardText=\'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local Application Not Found.</b> Install or configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings.</div>\';this.checkVersionCombatibility();}else{this.requestLocalApiToCheckOnenetInfustructure(localApi);}});}\nrequestLocalApiToCheckOnenetInfustructure(localApi){var headers=[];headers[\'no-global-error\']=\'yes\';headers[\'no-global-loader\']=\'yes\';this.infoCardRef.getFromUrlWithCustomHeaders(localApi+\'/check-connectivity\',headers,(response,result)=>{if(result==false){this.infoCardRef.dto.cardText=\'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local API Application Version is Old.</b> Please upgrade to the latest Version.</div>\';}else{if(response.code==\'0\'){this.infoCardRef.dto.cardText=\'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> You are ready to Provide & Consume Data.\';this.infoCardRef.dto.iconColor=\'#4cb96e\';}else if(response.code==\'1\'||response.code==\'2\'||response.code==\'3\'){this.infoCardRef.dto.cardText=\'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> Install or configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings.</div>\';this.infoCardRef.dto.iconColor=\'#aeaeae\';}else{this.infoCardRef.dto.cardText=\'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> Configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings or talk to your network Administrator.</div>\';this.infoCardRef.dto.iconColor=\'#c1c100\';}}\nthis.checkVersionCombatibility();});}\ncheckVersionCombatibility(){let uiVersion=this.getUiVersion();this.getBackendVersionAndCompare(uiVersion);}\ngetBackendVersionAndCompare(uiVersion){var headers=[];headers[\'no-global-error\']=\'yes\';headers[\'no-global-loader\']=\'yes\';this.infoCardRef.getFromBackendWithCustomHeaders(\'/info/version\',headers,(response,result)=>{let backendVersion=\"\";if(result==false){backendVersion=\"1.0\";}else{backendVersion=response[\'version\'];}\nif(uiVersion!=backendVersion){this.infoCardRef.dto.cardText=this.infoCardRef.dto.cardText+\'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local Ui Version</b> is <b>\'+uiVersion+\'</b> while <b>Central Registry Version</b> is <b>\'+backendVersion+\'</b>. \'+\'Upgrade Local Ui to Latest Version following the instructions on this <b><a style=\"color: #D57676;text-decoration: none;\" target=\"_blank\" href=\"https://github.com/european-dynamics-rnd/OneNet/wiki/Upgrade-Local-Api-to-the-latest-Version\">link</a></b>.\';this.infoCardRef.dto.iconColor=\'#D57676\';}});}\ngetUiVersion(){let uiVersion=\'\';if(localStorage.getItem(\'uiVersion\')){uiVersion=localStorage.getItem(\'uiVersion\');}else{uiVersion=\'1.0\';}\nreturn uiVersion;}\nnativeListEventsHandler(type,metadata){if((type==\'onInfoCardOpen\')&&(typeof this.onInfoCardOpen==\"function\"))this.onInfoCardOpen(metadata);if((type==\'onInfoCardDataLoaded\')&&(typeof this.onInfoCardDataLoaded==\"function\"))this.onInfoCardDataLoaded(metadata);}}'),
