llback){return this.getFromUrlRef(url,callback);}\nnativeListEventsHandler(type,metadata){if((type==\'onInfoCardOpen\')&&(typeof this.onInfoCardOpen==\"function\"))this.onInfoCardOpen(metadata);if((type==\'onInfoCardDataLoaded\')&&(typeof this.onInfoCardDataLoaded==\"function\"))this.onInfoCardDataLoaded(metadata);}}');
INSERT INTO `info_card_script` (`id`, `name`, `script`, `short_order`, `info_card_id`) VALUES
('292c4d7e-165f-4fba-9b61-8a04215db441', 'Script1', 'onInfoCardOpen(type) {\r\n     this.getUserData();\r\n}\r\n\r\ngetUserData(){\r\n    this.getFromBackend(\r\n        \'/custom-query/data-objects/?id=e48046c9-0b94-41d2-9ad4-206f1604b821\',\r\n        (response) => {\r\n           console.log(response[0][\'ed_api_url\']);\r\n           this.checkLocalApiExistance(response[0][\'ed_api_url\']);\r\n        }\r\n    );\r\n}\r\n\r\ncheckLocalApiExistance(localApi) {\r\n    \r\n    var headers = [];\r\n    headers[\'no-global-error\'] = \'yes\';\r\n    headers[\'no-global-loader\'] = \'yes\';\r\n    this.infoCardRef.getFromUrlWithCustomHeaders(\r\n        localApi + \'/health\',\r\n        headers,\r\n        (response,result) => {\r\n            if(result == false){\r\n                this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local Application Not Found.</b> Install or configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings.</div>\';\r\n                this.checkVersionCombatibility();\r\n            } else {\r\n                this.requestLocalApiToCheckOnenetInfustructure(localApi);\r\n            }\r\n        }\r\n    );\r\n    \r\n}\r\n\r\nrequestLocalApiToCheckOnenetInfustructure(localApi){\r\n    var headers = [];\r\n    headers[\'no-global-error\'] = \'yes\';\r\n    headers[\'no-global-loader\'] = \'yes\';\r\n    this.infoCardRef.getFromUrlWithCustomHeaders(\r\n        localApi + \'/check-connectivity\',\r\n        headers,\r\n        (response,result) => {\r\n            if(result == false){\r\n                this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local API Application Version is Old.</b> Please upgrade to the latest Version.</div>\';\r\n            } else {\r\n                if(response.code == \'0\'){\r\n                      this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> You are ready to Provide & Consume Data.\';\r\n                      this.infoCardRef.dto.iconColor = \'#4cb96e\';\r\n                } else if(response.code == \'1\' || response.code == \'2\' || response.code == \'3\'){\r\n                      this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> Install or configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings.</div>\';\r\n                      this.infoCardRef.dto.iconColor = \'#aeaeae\';\r\n                } else {\r\n                      this.infoCardRef.dto.cardText = \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>\'+response.message+\'.</b> Configure it properly from your <i class=\"fa fa-gear\"></i> Connector Settings or talk to your network Administrator.</div>\';\r\n                      this.infoCardRef.dto.iconColor = \'#c1c100\';\r\n                }\r\n            }\r\n            this.checkVersionCombatibility(); \r\n        }\r\n    );\r\n}\r\n\r\ncheckVersionCombatibility() {\r\n let uiVersion = this.getUiVersion();\r\n this.getBackendVersionAndCompare(uiVersion);\r\n}\r\n\r\ngetBackendVersionAndCompare(uiVersion) {\r\n    var headers = [];\r\n    headers[\'no-global-error\'] = \'yes\';\r\n    headers[\'no-global-loader\'] = \'yes\';\r\n    this.infoCardRef.getFromBackendWithCustomHeaders(\r\n        \'/info/version\',\r\n        headers,\r\n        (response,result) => {\r\n            let backendVersion = \"\";\r\n            if(result == false){\r\n               backendVersion = \"1.0\";\r\n            } else {\r\n               backendVersion = response[\'version\'];\r\n            }\r\n            \r\n            if(uiVersion != backendVersion){\r\n                   this.infoCardRef.dto.cardText =\r\n                   this.infoCardRef.dto.cardText +\r\n                   \'<div style=\"padding-bottom: 14px;font-size: 12px;\"><b>Local Ui Version</b> is <b>\' + uiVersion + \'</b> while <b>Central Registry Version</b> is <b>\' + backendVersion + \'</b>. \'+\r\n                   \'Upgrade Local Ui to Latest Version following the instructions on this <b><a style=\"color: #D57676;text-decoration: none;\" target=\"_blank\" href=\"https://github.com/european-dynamics-rnd/OneNet/wiki/Upgrade-Local-Api-to-the-latest-Version\">link</a></b>.\';\r\n                   this.infoCardRef.dto.iconColor = \'#D57676\';\r\n            }\r\n   \r\n        }\r\n    );\r\n}\r\n\r\ngetUiVersion() {\r\n    let uiVersion = \'\';\r\n    if (localStorage.getItem(\'uiVersion\')) {\r\n        uiVersion = localStorage.getItem(\'uiVersion\');\r\n    } else {\r\n        uiVersion = \'1.0\';\r\n    }\r\n    \r\n    return uiVersion;\r\n}', 0, '62e528c2-971b-4c44-a811-ea8fe596f02a');
