('4b277e03-a29f-4f3c-bdb1-7428a5096922', NULL, 'subscriptions', NULL, NULL, NULL, 'Subscriptions', b'1', NULL, 'SELECT GROUP_CONCAT(tbl.name SEPARATOR \'<br>\') FROM   (SELECT tbl1.offering_id,           tbl1.name    FROM      (SELECT dr.data_catalog_data_offering_id AS offering_id,              CONCAT(\'<span class=\"active\"> <i class=\"fa-solid fa-circle\"></i> \', cr.name, \' <i class=\"fa fa-caret-right\"></i> \', ur.username, \'</span> \') AS name       FROM data_catalog_data_requests dr       INNER JOIN user ur ON ur.id = dr.owner_id       INNER JOIN company cr ON cr.id = ur.company_id       WHERE dr.status = \'accept\' ) tbl1    UNION ALL         SELECT tbl2.offering_id,                     tbl2.name    FROM      (SELECT dr.data_catalog_data_offering_id AS offering_id,              CONCAT(\'<span class=\"inactive\"> <i class=\"fa-solid fa-circle\"></i> \', cr.name, \' <i class=\"fa fa-caret-right\"></i> \', ur.username, \'</span> \') AS name       FROM data_catalog_data_requests dr       INNER JOIN user ur ON ur.id = dr.owner_id       INNER JOIN company cr ON cr.id = ur.company_id       WHERE dr.status != \'accept\' ) tbl2) tbl WHERE tbl.offering_id = data_catalog_data_offerings.id', NULL, 'sql', b'0', b'0', NULL, '=', b'0', NULL, 10, 'simple-field', b'1', NULL, NULL, NULL, NULL, NULL, NULL, '739c8a45-7811-496e-a3f5-05c15a2354f6', NULL, NULL, NULL),
