INSERT INTO `timeline` (`id`, `created_by`, `created_on`, `modified_by`, `modified_on`, `short_order`, `title`, `query`, `description`, `icon`, `has_pagination`, `page_size`) VALUES
('d1108b32-ddd4-4ae5-98e2-a47d28c04d43', 'da7a00e9-3b19-454d-b72b-8646d6eae678', '2022-09-23 12:42:24', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-12-01 08:16:16', NULL, 'Data Exchanges Timeline (All Users)', 'SELECT \n\nres.name AS title, \nres.description, \nres.color,\nres.icon, \nres.min_title,\nres.nav,\nres.left_side\nFROM \n\n(SELECT \nd.title AS name, \nCONCAT(\'<b><i class=\"fa fa-pencil-alt\"></i> Description: </b>\',IFNULL(d.description,\'\'),\'<br><span><b><i class=\"fa fa-folder-tree\"></i> Category: </b>\',dc.name, \' <i class=\"fa fa-caret-right\"></i> \',ds.name, \' <i class=\"fa fa-caret-right\"></i> \',bo.name, \'</span>\', \'<br><b><i class=\"fa fa-clock\"></i> Created On: </b>isoToClientDateTimeFormat(\',date_format(d.created_on,\'%Y-%m-%dT%T\'), \'.000+00:00)<br><b><i class=\"fa fa-user\"></i> Created by: </b>\', c.name, \' <i class=\"fa fa-caret-right\"></i> \', u.username   ) as description,\n\'#51bcda\' AS color,\n\'fa-file-medical\' AS icon, \n\'<i class=\"fa fa-search\"></i> View Data Provided\' AS min_title,\nCONCAT(\'FORM[LOCATE:(ID=050bd6b5-7466-4db1-bcdf-57c835e53bbc;SELECTION-ID=\',d.id,\'),TAB:new,SIDEBAR-STATUS:minimized]\') AS nav,\n1 AS left_side,\nd.created_on\nFROM data_send d\nINNER JOIN data_catalog_data_offerings od ON od.id = d.data_catalog_data_offerings_id\nINNER JOIN data_catalog_business_object bo ON bo.id = od.data_catalog_business_object_id\nINNER JOIN data_catalog_service ds ON ds.id = bo.data_catalog_service_id\nINNER JOIN data_catalog_category dc ON dc.id = ds.data_catalog_category_id\nINNER JOIN user u ON d.created_by = u.id\nINNER JOIN company c ON u.company_id = c.id\nWHERE d.created_by = (CASE WHEN IFNULL(:my_user,\'\') = \'\'  THEN d.created_by ELSE :my_user END)\nAND d.created_on >= (CASE WHEN IFNULL(:created_after,\'\') = \'\'  THEN d.created_on ELSE :created_after END) \nAND d.created_on <= (CASE WHEN IFNULL(:created_before,\'\') = \'\'  THEN d.created_on ELSE :created_before END) \n\nUNION ALL \n\nSELECT \nd.title AS name, \nCONCAT(\'<b><i class=\"fa fa-pencil-alt\"></i> Description: </b>\',IFNULL(d.description,\'\'),\'<br><span><b><i class=\"fa fa-folder-tree\"></i> Category: </b>\',dc.name, \' <i class=\"fa fa-caret-right\"></i> \',ds.name, \' <i class=\"fa fa-caret-right\"></i> \',bo.name, \'</span>\', \'<br><b><i class=\"fa fa-clock\"></i> Created On: </b>isoToClientDateTimeFormat(\',date_format(d.created_on,\'%Y-%m-%dT%T\'), \'.000+00:00)<br><b><i class=\"fa fa-user\"></i> Created by: </b>\', c.name, \' <i class=\"fa fa-caret-right\"></i> \', u.username, \'<br><b><i class=\"fa fa-user\"></i> Consumed by: </b>\', c2.name, \' <i class=\"fa fa-caret-right\"></i> \', u2.username) as description,\n\'#ef8157\' AS color,\n\'fa-file-import\' AS icon, \n\'<i class=\"fa fa-search\"></i> View Data Consumed\' AS min_title,\nCONCAT(\'FORM[LOCATE:(ID=5c643443-6cb0-48b2-b166-02a0a3d0ce7c;SELECTION-ID=\',d.id,\'),TAB:new,SIDEBAR-STATUS:minimized]\') AS nav,\n0 AS left_side,\nd.created_on\nFROM data_catalog_data_requests r \nINNER JOIN data_catalog_data_offerings o ON r.data_catalog_data_offering_id = o.id\nINNER JOIN data_send d ON d.data_catalog_data_offerings_id = o.id\nINNER JOIN data_catalog_business_object bo ON bo.id = o.data_catalog_business_object_id\nINNER JOIN data_catalog_service ds ON ds.id = bo.data_catalog_service_id\nINNER JOIN data_catalog_category dc ON dc.id = ds.data_catalog_category_id\nINNER JOIN user u ON d.created_by = u.id\nINNER JOIN company c ON u.company_id = c.id\nINNER JOIN user u2 ON r.owner_id = u2.id\nINNER JOIN company c2 ON u2.company_id = c2.id\nWHERE r.status = \'accept\'\nAND r.owner_id = (CASE WHEN IFNULL(:my_user,\'\') = \'\' THEN r.owner_id ELSE :my_user END)\nAND d.created_on >= (CASE WHEN IFNULL(:created_after,\'\') = \'\'  THEN d.created_on ELSE :created_after END) \nAND d.created_on <= (CASE WHEN IFNULL(:created_before,\'\') = \'\'  THEN d.created_on ELSE :created_before END)) res \nORDER BY res.created_on DESC', 'View your data exchange history', 'fa-timeline', b'1', 10),
('d6342c52-8995-4a0d-b42d-894ffc600a3d', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-09-23 08:53:51', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2023-12-15 12:02:10', NULL, 'Data Exchanges Timeline', 'SELECT \r\n\r\nres.name AS title, \r\nres.description, \r\nres.color,\r\nres.icon, \r\nres.min_title,\r\nres.nav,\r\nres.left_side\r\nFROM \r\n\r\n(SELECT \r\nd.title AS name, \r\nCONCAT(\'<b><i class=\"fa fa-pencil-alt\"></i> Description: </b>\',d.description,\'<br><span><b><i class=\"fa fa-folder-tree\"></i> Category: </b>\',dc.name, \' <i class=\"fa fa-caret-right\"></i> \',ds.name, \' <i class=\"fa fa-caret-right\"></i> \',bo.name, \'</span>\', \r\n\'<br><b><i class=\"fa fa-file\"></i> File Name: </b>\',d.fileName,\r\n\'<br><b><i class=\"fa fa-file-arrow-down\"></i> File Size: </b>\',ROUND(d.fileSize / 1024, 3),\' Kb\',\r\n\'<br><b><i class=\"fa fa-clock\"></i> Created On: </b>isoToClientDateTimeFormat(\',date_format(d.created_on,\'%Y-%m-%dT%T\'), \'.000+00:00)\') as description,\r\n\'#51bcda\' AS color,\r\n\'fa-file-medical\' AS icon, \r\n\'<i class=\"fa fa-search\"></i> View Data Provided\' AS min_title,\r\nCONCAT(\'FORM[LOCATE:(ID=050bd6b5-7466-4db1-bcdf-57c835e53bbc;SELECTION-ID=\',d.id,\'),TAB:new,SIDEBAR-STATUS:minimized]\') AS nav,\r\n1 AS left_side,\r\nd.created_on\r\nFROM data_send d\r\nINNER JOIN data_catalog_data_offerings od ON od.id = d.data_catalog_data_offerings_id\r\nINNER JOIN data_catalog_business_object bo ON bo.id = od.data_catalog_business_object_id\r\nINNER JOIN data_catalog_service ds ON ds.id = bo.data_catalog_service_id\r\nINNER JOIN data_catalog_category dc ON dc.id = ds.data_catalog_category_id\r\nWHERE d.created_by = :userid\r\nAND d.created_on >= (CASE WHEN IFNULL(:created_after,\'\') = \'\'  THEN d.created_on ELSE :created_after END) \r\nAND d.created_on <= (CASE WHEN IFNULL(:created_before,\'\') = \'\'  THEN d.created_on ELSE :created_before END)\r\nAND d.status = \'active\'\r\n\r\nUNION ALL \r\n\r\nSELECT \r\nd.title AS name, \r\nCONCAT(\'<b><i class=\"fa fa-pencil-alt\"></i> Description: </b>\',d.description,\'<br><span><b><i class=\"fa fa-folder-tree\"></i> Category: </b>\',dc.name, \' <i class=\"fa fa-caret-right\"></i> \',ds.name, \' <i class=\"fa fa-caret-right\"></i> \',bo.name, \'</span>\', \r\n\'<br><b><i class=\"fa fa-file\"></i> File Name: </b>\',d.fileName,\r\n\'<br><b><i class=\"fa fa-file-arrow-down\"></i> File Size: </b>\',ROUND(d.fileSize / 1024, 3),\' Kb\',\r\n\'<br><b><i class=\"fa fa-clock\"></i> Created On: </b>isoToClientDateTimeFormat(\',date_format(d.created_on,\'%Y-%m-%dT%T\'), \'.000+00:00)<br><b><i class=\"fa fa-user\"></i> Created by: </b>\', c.name, \' <i class=\"fa fa-caret-right\"></i> \', u.username) as description,\r\n\'#ef8157\' AS color,\r\n\'fa-file-import\' AS icon, \r\n\'<i class=\"fa fa-search\"></i> View Data Consumed\' AS min_title,\r\nCONCAT(\'FORM[LOCATE:(ID=5c643443-6cb0-48b2-b166-02a0a3d0ce7c;SELECTION-ID=\',d.id,\'),TAB:new,SIDEBAR-STATUS:minimized]\') AS nav,\r\n0 AS left_side,\r\nd.created_on\r\nFROM data_catalog_data_requests r \r\nINNER JOIN data_catalog_data_offerings o ON r.data_catalog_data_offering_id = o.id\r\nINNER JOIN data_send d ON d.data_catalog_data_offerings_id = o.id\r\nINNER JOIN data_catalog_business_object bo ON bo.id = o.data_catalog_business_object_id\r\nINNER JOIN data_catalog_service ds ON ds.id = bo.data_catalog_service_id\r\nINNER JOIN data_catalog_category dc ON dc.id = ds.data_catalog_category_id\r\nINNER JOIN user u ON d.created_by = u.id\r\nINNER JOIN company c ON u.company_id = c.id\r\nWHERE r.status = \'accept\'\r\nAND d.status = \'active\'\r\nAND r.owner_id = :userid \r\nAND d.created_on >= (CASE WHEN IFNULL(:created_after,\'\') = \'\'  THEN d.created_on ELSE :created_after END) \r\nAND d.created_on <= (CASE WHEN IFNULL(:created_before,\'\') = \'\'  THEN d.created_on ELSE :created_before END)) res \r\nORDER BY res.created_on DESC', 'View your data exchange history', 'fa-timeline', b'1', 10);
